import React from "react";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
	root: {
		borderBottom: "5px solid #e6e6e6"
	}
});
const Stocks = props => {
	const classes = useStyles();
	return (
		<div className={classes.root}>
			<h1>Buy</h1>
		</div>
	);
};

export default Stocks;
